import React from 'react'

export default function ListAnime() {
    const uri="https://cdn.animevietsub.biz/data/poster/2024/11/30/animevsub-ptJf6ZLFGE.jpg"
    let imgs=[];
    for(let i=0;i<10;i++)
    {
        imgs.push(uri);
    }
  return (
    <div className='w-full grid gap-2 overflow-x-scroll'>
        {imgs.map((img)=>(
            <img src={img} alt='img' className='w-full'></img>
        ))}
    </div>
  )
}
